import React from 'react';
import '../../App.css';
import './About.css';


export default function About() {
    return (
    <>

        <h1 className='about'>ABOUT</h1>

        <h1 className='title'> GET TO KNOW ME!</h1>
        <img className='descriptionphoto'src="images/mtl.jpg" alt="DescriptionPhoto"></img>
        <p className='descriptioncont'> Hey there! I am a first year student at Waterloo, and am currently pursuing a degree in Computer Science. 
            I hope to work in the financial tech industry, and am currently seeking Summer 2022 Internships!</p>
        <p className='descriptioncont'>In my free time, I enjoy baking, trying new foods, watching movies and learning new languages! My current goal is to become fluent in French, and hopefully Korean in the future. I used to dance ballet and play the violin, and still occasionally do both of these activities.
            My current goal is to read 12 books this year. Some of my favourite novels include Wonder, 1984, and the Glass Hotel. Add me on GoodReads @Alena so we can recommend books to each other! </p>
         <p className='descriptioncont'> I love to travel as well and a few countries I have been to include Cambodia, Netherlands, France, Austria, Belgium, and Italy. I hope to travel some more through co-op, and hopefully during my free time when the pandemic comes to an end.</p>


    </>);


}
